import React from 'react';
import './App.css';
import 'tachyons';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <div className="f1 tc">
            <h1>Robo Friends</h1>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
